import styled from "styled-components";

export const WorkConteiner = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
`;
export const ConteinerText = styled.p`
  width: 382px;
  color: ${(props) => props.theme.colors.white};
  text-align: center;
  margin-bottom: 16px;
  font-family: ${(props) => props.theme.fonts.kumarOne42Regular.family};
  font-size: ${(props) => props.theme.fonts.kumarOne42Regular.size};
  font-weight: ${(props) => props.theme.fonts.kumarOne42Regular.weight};
  line-height: ${(props) => props.theme.fonts.kumarOne42Regular.lineHeight};
`;
